import React from "react";
import "../css/FileItem.css";
import {
  BsFileEarmarkCheckFill,
  BsFillFileEarmarkXFill,
} from "react-icons/bs";
const FileItem = ({ submit, file, rejected }) => {
  console.log(file);

  return (
    <div className="fileItem">
      {!rejected ? <BsFileEarmarkCheckFill className="fileIcon" /> : <BsFillFileEarmarkXFill />}
      <div className="fileContent">
        <h3>{file.name}</h3>
        <p>{file.size} bytes</p>
      </div>
      {!rejected ? (
        <div className="fileButton" onClick={() => submit()}>
          Next
        </div>
      ) : (
        <h5>File Rejected</h5>
      )}
    </div>
  );
};

export default FileItem;
